ms) = (F_h - F_m - F_s) / (F_h + F_m + F_s)\n\nClass labels:\n\n    AGN,\n    AB,\n    CV,\n    qLMXB,\n    MSP,\n    Spider,\n\nUnclassified objects or objects with different class labels are shown as white circles.\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\n"],["readme_text","\n\nThis website was built with the Python Bokeh and Panel libraries.\n\nThe user can:\n\u2022 Select visible classes\n\u2022 Select features used for each axis\n\u2022 Invert and apply log scale to axes with checkboxes to the right of the figure\n\nSelectable features are:\n\u2022 CSC 2.1 X-ray fluxes and luminosities in the soft (0.5-2 keV), medium (2-4.5 keV), hard (4.5-7 keV), and broad (0.5-7 keV) bands\n\u2022 CSC 2.1 intra- and inter-obsevation variability probabilities\n\u2022 CSC 2.1 significance\n\u2022 HUGS absolute magnitudes and colors in the F275W, F336W, F438W, F606W, and F814W bands\n\u2022 Other HST absolute magnitudes and colors with significant number of sources observed in the F555W, F625W, and F658N bands\n\u2022 Chandra hardness ratios, defined as (F_m - F_s) / (F_m + F_s), (F_h - F_m) / (F_h + F_m), and (F_h - (F_m + F_s)) / (F_h + (F_m + F_s))\n\nBokeh plot tools in the toolbar to the top right of the figure allows additional interactivity: \n\u2022 Pan tool: click and drag to pan the figure\n\u2022 Wheel zoom tool: Zoom and rescale the figure itself, as well as the axes\n\u2022 Tap tool: select a single source by clicking, which displays a table of properties for that source to the right\n\u2022 Lasso tool: Select multiple sources, which then remains selected for any combination of features plotted, and can be viewed in the table below the plot\n\u2022 Download tool: download the figure as a png\n\u2022 Reset tool: reset figure axis ranges\n\nThe table button below the figure opens an interactive table, which has these features:\n\n\u2022 Selectable columns, including ADS reference for each source\n\u2022 Sorting for each column\n\u2022 Interactive AladinLite (https://aladin.cds.unistra.fr/AladinLite/) and ESASky (https://sky.esa.int/esasky/) windows, displaying images at the coordinates of each source in user selectable surveys\n\u2022 Exporting the dataset to csv, Excel, or PDF formats\n\nThe user can also upload a csv file with custom objects to plot. See the upload help text for instructions.\n\n\n"],["html_title","CSC Training Dataset"],["get_ref_link_js","\n\n    function get_ref_link(ref) {\n    \n        var ref_link\n        \n        if (ref=='INTEGRAL General Reference Catalog') {\n            ref_link = 'https://www.isdc.unige.ch/integral/science/catalogue'\n            ref = 'INTEGRAL'\n        }    \n        else if (ref=='Simbad' || ref=='SIMBAD')\n            ref_link = 'http://simbad.u-strasbg.fr/simbad/'\n        else if (ref=='LAMOST-DR8-AFGK' || ref=='LAMOST-DR8-M')\n            ref_link = 'http://www.lamost.org/dr8/'\n        else\n            ref_link = 'https://ui.adsabs.harvard.edu/abs/' + ref + '/abstract' \n\n        ref_link = '&lt;a href=\"' + ref_link + '\" target=\"_blank\"&gt;' + ref + '&lt;/a&gt;'    \n\n        return [ref, ref_link]\n    \n    }\n"],["format_js"," \n\n    function format(d, shadowroot) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name_csc = table_source.data['name_csc'][i]\n        \n        var div_id = `\"aladin-lite-div` + name_csc.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n\n        var aladin_div = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&gt;&lt;/div&gt;'\n        \n        var aladin_script = 'var aladin = A.aladin(document.querySelector(\"div\").children[0].shadowRoot.querySelector(\"div.bk-Column\").shadowRoot.querySelector(\"div:nth-child(23)\").shadowRoot.querySelector(\"div.bk-Div\").shadowRoot.querySelector(\"#' + div_id.slice(1) + '), {survey: \"P/2MASS/color\", fov:0.05, cooFrame:\"ICRSd\", target: \"' + table_source.data['ra_csc'][i] + ', ' + table_source.data['dec_csc'][i] + '\"});'\n        \n non_features",["name_cat","name","ra","dec","Class","SubClass","ref"]],["features",["F_b","F_h","F_m","F_s","P_inter","P_intra","Signif.","G","BP","RP","J","H","K","W1","W2","W3","rgeo","HR_ms","HR_hm","HR_h(ms)","F_x/F_o","BP-G","BP-RP","G-K","J-H","H-K","W1-W2","M_G"]],["title_text","X-ray and multiwavelength properties of classified sources from CSC 2.0"],["cite_text","Please cite &lt;a href=\"https://home.gwu.edu/~kargaltsev/XCLASS_GC/\"&gt; Chen et al. (2023)&lt;/a&gt; if you made use of this tool."],["ackn_text","This work was supported by NASA Chandra Awards AR3-14017X, AR9-20005A, and AR0-21007X and by NASA ADAP award 80NSSC19K0576."],["description_text","&lt;a href=\"./globular_cluster_TD_auxiliary.pdf\" target=\"_blank\"&gt;Auxiliary Information&lt;/a&gt;"],["download_text","&lt;a href=\"./td_gc_csc_rn.csv\" download&gt;Download Full Dataset&lt;/a&gt;"],["contact_text","&lt;a href = \"mailto: huiyang@gwmail.gwu.edu\" target=\"_blank\"&gt;Contact&lt;/a&gt;"],["upload_help_text","\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored):\n\n    name_csc\n    name_lit\n    ra_csc\n    dec_csc\n    Class \n    ref \n\n    F_b \n    F_h \n    F_m \n    F_s \n\n    L_b\n    L_h\n    L_m\n    L_s\n\n    P_inter \n    P_intra \n\n    Signif.\n\n    F275W_h_abs\n    F336W_h_abs \n    F438W_h_abs\n    F606W_h_abs\n    F814W_h_abs\n\n    F275W-F336W\n    F336W-F438W\n    F438W-F606W\n    F606W-F814W\n\n    F555W_abs\n    F625W_abs\n    F658N_abs\n\n    F555W-F625W\n    F625W-F658N\n\nAll columns are optional. \n\nThe following features are calculated from the user-supplied data:\n\n    HR_ms\n    HR_hm \n    HR_h(ms)\n\nHR_ms = (F_m - F_s) / (F_m + F_s)\nHR_hm = (F_h - F_m) / (F_h + F_m)\nHR_h(ms) = (F_h - F_m - F_s) / (F_h + F_m + F_s)\n\nClass labels:\n\n    AGN,\n    AB,\n    CV,\n    qLMXB,\n    MSP,\n    Spider,\n\nUnclassified objects or objects with different class labels are shown as white circles.\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\n"],["readme_text","\n\nThis website was built with the Python Bokeh and Panel libraries.\n\nThe user can:\n\u2022 Select visible classes\n\u2022 Select features used for each axis\n\u2022 Invert and apply log scale to axes with checkboxes to the right of the figure\n\nSelectable features are:\n\u2022 CSC 2.1 X-ray fluxes and luminosities in the soft (0.5-2 keV), medium (2-4.5 keV), hard (4.5-7 keV), and broad (0.5-7 keV) bands\n\u2022 CSC 2.1 intra- and inter-obsevation variability probabilities\n\u2022 CSC 2.1 significance\n\u2022 HUGS absolute magnitudes and colors in the F275W, F336W, F438W, F606W, and F814W bands\n\u2022 Other HST absolute magnitudes and colors with significant number of sources observed in the F555W, F625W, and F658N bands\n\u2022 Chandra hardness ratios, defined as (F_m - F_s) / (F_m + F_s), (F_h - F_m) / (F_h + F_m), and (F_h - (F_m + F_s)) / (F_h + (F_m + F_s))\n\nBokeh plot tools in the toolbar to the top right of the figure allows additional interactivity: \n\u2022 Pan tool: click and drag to pan the figure\n\u2022 Wheel zoom tool: Zoom and rescale the figure itself, as well as the axes\n\u2022 Tap tool: select a single source by clicking, which displays a table of properties for that source to the right\n\u2022 Lasso tool: Select multiple sources, which then remains selected for any combination of features plotted, and can be viewed in the table below the plot\n\u2022 Download tool: download the figure as a png\n\u2022 Reset tool: reset figure axis ranges\n\nThe table button below the figure opens an interactive table, which has these features:\n\n\u2022 Selectable columns, including ADS reference for each source\n\u2022 Sorting for each column\n\u2022 Interactive AladinLite (https://aladin.cds.unistra.fr/AladinLite/) and ESASky (https://sky.esa.int/esasky/) windows, displaying images at the coordinates of each source in user selectable surveys\n\u2022 Exporting the dataset to csv, Excel, or PDF formats\n\nThe user can also upload a csv file with custom objects to plot. See the upload help text for instructions.\n\n\n"],["html_title","CSC Training Dataset"],["get_ref_link_js","\n\n    function get_ref_link(ref) {\n    \n        var ref_link\n        \n        if (ref=='INTEGRAL General Reference Catalog') {\n            ref_link = 'https://www.isdc.unige.ch/integral/science/catalogue'\n            ref = 'INTEGRAL'\n        }    \n        else if (ref=='Simbad' || ref=='SIMBAD')\n            ref_link = 'http://simbad.u-strasbg.fr/simbad/'\n        else if (ref=='LAMOST-DR8-AFGK' || ref=='LAMOST-DR8-M')\n            ref_link = 'http://www.lamost.org/dr8/'\n        else\n            ref_link = 'https://ui.adsabs.harvard.edu/abs/' + ref + '/abstract' \n\n        ref_link = '&lt;a href=\"' + ref_link + '\" target=\"_blank\"&gt;' + ref + '&lt;/a&gt;'    \n\n        return [ref, ref_link]\n    \n    }\n"],["format_js"," \n\n    function format(d, shadowroot) {\n            \n        var i = Number(d.DT_RowId.slice(2))\n        \n        var name_csc = table_source.data['name_csc'][i]\n        \n        var div_id = `\"aladin-lite-div` + name_csc.replace(/[^A-Z0-9]+/ig, \"_\") + `\"`\n\n        var aladin_div = '&lt;div id=' + div_id + ' style=\"width:400px;height:400px;\"&gt;&lt;/div&gt;'\n        \n        var aladin_script = 'var aladin = A.aladin(document.querySelector(\"div\").children[0].shadowRoot.querySelector(\"div.bk-Column\").shadowRoot.querySelector(\"div:nth-child(23)\").shadowRoot.querySelector(\"div.bk-Div\").shadowRoot.querySelector(\"#' + div_id.slice(1) + '), {survey: \"P/2MASS/color\", fov:0.05, cooFrame:\"ICRSd\", target: \"' + table_source.data['ra_csc'][i] + ', ' + table_source.data['dec_csc'][i] + '\"});'\n        \n        var esa_sky = 'https://sky.esa.int/?target=' + table_source.data['ra_csc'][i] + '%20' + table_source.data['dec_csc'][i] + \n unction csvToArray(text) {\n            let p = '', row = [''], ret = [row], i = 0, r = 0, s = !0, l;\n            for (l of text) {\n                if ('\"' == l) {\n                    if (s &amp;&amp; l == p) row[i] += l;\n                    s = !s;\n                } \n                else if (',' == l &amp;&amp; s) \n                    l = row[++i] = '';\n                else if ('\\n' == l &amp;&amp; s) {\n                    if ('\\r' == p) row[i] = row[i].slice(0, -1);\n                    row = ret[++r] = [l = '']; \n                    i = 0;\n                } \n                else row[i] += l;\n                p = l;\n            }\n            return ret;\n        }\n        \n        let obj = csvToArray(atob(this.value).trim())\n\n        let len = obj.length - 1\n\n        //transpose\n        obj = obj[0].map((col, i) =&gt; obj.map(([...row]) =&gt; row[i]))\n\n        let df_custom = {}\n        \n        // !!!\n        \n        for (var ob of obj) {\n        \n            let name = ob[0]\n        \n            if (!(name in all_dict)) {\n            \n                if (name in q['all']) \n                        \n                    name = q['all'][name]['label'] \n                                      \n                else continue\n                                        \n            } \n\n            let sl = ob.slice(1)\n            \n            if (name in all_dict)             \n                if (all_dict[name]['format'].match(/to/) != null)\n                    sl = sl.map(parseFloat)\n\n            df_custom[name] = sl    \n        }\n        \n            \n        function replace_from_dict(arr, dic) {\n\n            var out = [];\n            \n            for (var i=0; i&lt;arr.length; i++) {\n            \n                 var cl = arr[i];\n                 \n                 if (cl in dic)                \n                     out.push(dic[cl])\n                 else    \n                     out.push(cl)\n                       \n            }\n            \n            return out\n            \n         }   \n         \n         df_custom[q['class_column']] = replace_from_dict(df_custom[q['class_column']], q['classes_dict']) \n \n\n        \n\n    \n\n    var color_features = ['BP-G', 'BP-RP', 'G-K', 'J-H', 'H-K', 'W1-W2']\n\n    for (var f of color_features) {\n    \n        var s = f.split('-')\n        \n        //console.log('s: ', s)\n        \n        //console.log('df_custom: ', df_custom)\n        \n        //console.log('df_custom[s[0]]: ', df_custom[s[0]])\n        \n        df_custom[f] = df_custom[s[0]].map(function (v, i) { return v - df_custom[s[1]][i]; })\n    \n    }\n        \n    function hr(a, b) {\n    \n        let c = a + b\n        \n        if (c==0) return NaN    \n    \n        return (a - b) / c;\n    };\n    \n    df_custom['HR_ms'] = df_custom['F_m'].map(function (v, i) { return hr(v, df_custom['F_s'][i]); })\n    df_custom['HR_hm'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i]); })\n    df_custom['HR_h(ms)'] = df_custom['F_h'].map(function (v, i) { return hr(v, df_custom['F_m'][i] + df_custom['F_s'][i]); })\n    \n    df_custom['F_x/F_o'] = df_custom['F_b'].map(function (v, i) { \n        return Math.pow(10, Math.log10(v) + 5 - Math.log10(1.65) + df_custom['G'][i] / 2.5); })\n            \n    //df_custom[class_column] = df_custom[class_column].map(x =&gt; x.replace('ATNF', 'NS'))\n    \n    //df_custom['P_inter'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    //df_custom['P_intra'] = df_custom['P_intra'].map(x =&gt; 1.001 - x)\n    \n    if ('rgeo' in df_custom) \n    \n        df_custom['M_G'] = df_custom['rgeo'].map(function (v, i) { \n            return df_custom['G'][i] - 5 * Math.log10(v/10); })\n        \n    //df_custom['P_intra'] = df_custom['P_inter'].map(x =&gt; 1.001 - x)\n    \n\n\n        var feat_x = features[sel_x.active]\n        var feat_y = features[sel_y.active]\n\n        if (log_source.data[feat_x][0] == 1) {\n        \n            if (['P_intra', 'P_inter'].includes(feat_x))         \n                df_custom['x'] = df_custom[feat_x].map(x =&gt; Math.log10(1/(1.001 - x)))   \n            else\n                df_custom['x'] = df_custom[feat_x].map(x =&gt; Math.log10(x)) \n            \n        } else { \n            if (['P_intra', 'P_inter'].includes(feat_x))         \n                df_custom['x'] = df_custom[feat_x].map(x =&gt; 1/(1.001 - x))   \n            else\n                df_custom['x'] = df_custom[feat_x]\n        }         \n \n        if (log_source.data[feat_y][0] == 1) {\n        \n            if (['P_intra', 'P_inter'].includes(feat_y))         \n                df_custom['y'] = df_custom[feat_y].map(x =&gt; Math.log10(1/(1.001 - x)))   \n            else\n                df_custom['y'] = df_custom[feat_y].map(x =&gt; Math.log10(x)) \n            \n        } else { \n            if (['P_intra', 'P_inter'].includes(feat_y))         \n                df_custom['y'] = df_custom[feat_y].map(x =&gt; 1/(1.001 - x))   \n            else\n                df_custom['y'] = df_custom[feat_y]\n        }         \n        \n        df_custom['color'] = []\n\n        for (var x of df_custom[class_column]) {\n\n            if (colors_dict[x])\n                df_custom['color'].push(colors_dict[x])\n            else    \n                df_custom['color'].push('black')\n         }       \n\n        df_custom['line_color'] = Array(len).fill('black')\n        df_custom['size'] = Array(len).fill(15)\n\n        var r = {}\n\n        for (const [k, v] of Object.entries(df_custom)) { \n\n            var b = df_custom[k]\n\n            var c = new Array()            \n            for (var i of b)\n                c.push(i)   \n\n            r[k] = c\n\n        }  \n\n        sources['custom'].data = r    \n\n        sources['custom'].change.emit() \n\n        //obj = Object.entries(obj)    \n        //let obj_dict = Object.assign({}, ...obj.map((x) =&gt; ({[x[0]]: x[1:]}))) \n        //const obj2 = Object.fromEntries(obj[:,0].map((key, index)=&gt; [key, obj[index, 1:]))\n\n    "}},{"id":"p6817"},{"id":"p6826"}]]]},"width":200,"accept":".csv"}},{"id":"p6794"},{"type":"object","name":"Div","id":"p6787","attributes":{"text":"\n\n        \n    &lt;style&gt;\n        body {font-family: Arial, Helvetica, sans-serif;}\n\n        /* The Modal (background) */\n        .modal {\n          display: none; /* Hidden by default */\n          position: fixed; /* Stay in place */\n          z-index: 1; /* Sit on top */\n          padding-top: 50px; /* Location of the box */\n          padding-bottom: 50px;\n          left: 400px;\n          top: 0;\n          width: 50%; /* Full width */\n          height: 100%; /* Full height */\n          overflow: auto; /* Enable scroll if needed */\n          background-color: rgb(0,0,0); /* Fallback color */\n          background-color: rgba(0,0,0,0.4); /* Black w/ opacity */\n        }\n\n        /* Modal Content */\n        .modal-content {\n          background-color: #fefefe;\n          margin: auto;\n          padding: 20px;\n          border: 1px solid #888;\n          width: 80%;\n          white-space: pre-wrap;\n        }    \n    &lt;/style&gt;\n    \n\n        &lt;div id=\"readme\" class=\"modal\", style=\"display: none;\"&gt;\n\n            &lt;button onclick='document.querySelector(\"div\").children[0].shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(8)\").shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(19)\").shadowRoot.querySelector(\"#readme\").style.display=\"none\"'&gt;Close\n            &lt;/button&gt; \n\n            &lt;div class=\"modal-content\"&gt;\n\n                \n\nThis website was built with the Python Bokeh and Panel libraries.\n\nThe user can:\n\u2022 Select visible classes\n\u2022 Select features used for each axis\n\u2022 Invert and apply log scale to axes with checkboxes to the right of the figure\n\nSelectable features are:\n\u2022 CSC 2.1 X-ray fluxes and luminosities in the soft (0.5-2 keV), medium (2-4.5 keV), hard (4.5-7 keV), and broad (0.5-7 keV) bands\n\u2022 CSC 2.1 intra- and inter-obsevation variability probabilities\n\u2022 CSC 2.1 significance\n\u2022 HUGS absolute magnitudes and colors in the F275W, F336W, F438W, F606W, and F814W bands\n\u2022 Other HST absolute magnitudes and colors with significant number of sources observed in the F555W, F625W, and F658N bands\n\u2022 Chandra hardness ratios, defined as (F_m - F_s) / (F_m + F_s), (F_h - F_m) / (F_h + F_m), and (F_h - (F_m + F_s)) / (F_h + (F_m + F_s))\n\nBokeh plot tools in the toolbar to the top right of the figure allows additional interactivity: \n\u2022 Pan tool: click and drag to pan the figure\n\u2022 Wheel zoom tool: Zoom and rescale the figure itself, as well as the axes\n\u2022 Tap tool: select a single source by clicking, which displays a table of properties for that source to the right\n\u2022 Lasso tool: Select multiple sources, which then remains selected for any combination of features plotted, and can be viewed in the table below the plot\n\u2022 Download tool: download the figure as a png\n\u2022 Reset tool: reset figure axis ranges\n\nThe table button below the figure opens an interactive table, which has these features:\n\n\u2022 Selectable columns, including ADS reference for each source\n\u2022 Sorting for each column\n\u2022 Interactive AladinLite (https://aladin.cds.unistra.fr/AladinLite/) and ESASky (https://sky.esa.int/esasky/) windows, displaying images at the coordinates of each source in user selectable surveys\n\u2022 Exporting the dataset to csv, Excel, or PDF formats\n\nThe user can also upload a csv file with custom objects to plot. See the upload help text for instructions.\n\n\n\n\n            &lt;/div&gt;        \n\n        &lt;/div&gt;  \n\n        "}},{"type":"object","name":"Div","id":"p6790","attributes":{"text":"\n\n        \n    &lt;style&gt;\n        body {font-family: Arial, Helvetica, sans-serif;}\n\n        /* The Modal (background) */\n        .modal {\n          display: none; /* Hidden by default */\n          position: fixed; /* Stay in place */\n          z-index: 1; /* Sit on top */\n          padding-top: 50px; /* Location of the box */\n          padding-bottom: 50px;\n          left: 400px;\n          top: 0;\n          width: 50%; /* Full width */\n          height: 100%; /* Full height */\n          overflow: auto; /* Enable scroll if needed */\n          background-color: rgb(0,0,0); /* Fallback color */\n          background-color: rgba(0,0,0,0.4); /* Black w/ opacity */\n        }\n\n        /* Modal Content */\n        .modal-content {\n          background-color: #fefefe;\n          margin: auto;\n          padding: 20px;\n          border: 1px solid #888;\n          width: 80%;\n          white-space: pre-wrap;\n        }    \n    &lt;/style&gt;\n    \n\n        &lt;div id=\"upload_help\" class=\"modal\", style=\"display: none;\"&gt;\n\n            &lt;button onclick='document.querySelector(\"div\").children[0].shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(8)\").shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(20)\").shadowRoot.querySelector(\"#upload_help\").style.display=\"none\"'&gt;Close\n            &lt;/button&gt; \n\n            &lt;div class=\"modal-content\"&gt;\n\n                \n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\nFor plotting custom objects, the user should provide a csv file.\nThe following column labels are accepted (columns with other names are ignored):\n\n    name_csc\n    name_lit\n    ra_csc\n    dec_csc\n    Class \n    ref \n\n    F_b \n    F_h \n    F_m \n    F_s \n\n    L_b\n    L_h\n    L_m\n    L_s\n\n    P_inter \n    P_intra \n\n    Signif.\n\n    F275W_h_abs\n    F336W_h_abs \n    F438W_h_abs\n    F606W_h_abs\n    F814W_h_abs\n\n    F275W-F336W\n    F336W-F438W\n    F438W-F606W\n    F606W-F814W\n\n    F555W_abs\n    F625W_abs\n    F658N_abs\n\n    F555W-F625W\n    F625W-F658N\n\nAll columns are optional. \n\nThe following features are calculated from the user-supplied data:\n\n    HR_ms\n    HR_hm \n    HR_h(ms)\n\nHR_ms = (F_m - F_s) / (F_m + F_s)\nHR_hm = (F_h - F_m) / (F_h + F_m)\nHR_h(ms) = (F_h - F_m - F_s) / (F_h + F_m + F_s)\n\nClass labels:\n\n    AGN,\n    AB,\n    CV,\n    qLMXB,\n    MSP,\n    Spider,\n\nUnclassified objects or objects with different class labels are shown as white circles.\n\n&lt;a href=\"./custom.csv\"&gt;Example&lt;/a&gt;\n\n\n\n            &lt;/div&gt;        \n\n        &lt;/div&gt;  \n\n    "}},{"type":"object","name":"Div","id":"p6793","attributes":{"text":"\n\n        \n    &lt;style&gt;\n        body {font-family: Arial, Helvetica, sans-serif;}\n\n        /* The Modal (background) */\n        .modal {\n          display: none; /* Hidden by default */\n          position: fixed; /* Stay in place */\n          z-index: 1; /* Sit on top */\n          padding-top: 50px; /* Location of the box */\n          padding-bottom: 50px;\n          left: 400px;\n          top: 0;\n          width: 50%; /* Full width */\n          height: 100%; /* Full height */\n          overflow: auto; /* Enable scroll if needed */\n          background-color: rgb(0,0,0); /* Fallback color */\n          background-color: rgba(0,0,0,0.4); /* Black w/ opacity */\n        }\n\n        /* Modal Content */\n        .modal-content {\n          background-color: #fefefe;\n          margin: auto;\n          padding: 20px;\n          border: 1px solid #888;\n          width: 80%;\n          white-space: pre-wrap;\n        }    \n    &lt;/style&gt;\n    \n\n        &lt;div id=\"my_upload\" class=\"modal\", style=\"display: none;\"&gt;\n\n            &lt;button onclick='document.querySelector(\"div\").children[0].shadowRoot.querySelector(\"div:nth-child(7)\").shadowRoot.querySelector(\"div:nth-child(8)\").shadowRoot.
